import {
    BrowserRouter,
    Routes,
    Route,
} from "react-router-dom";
import RegistrationForm from "./RegistrationForm";

const ImageApp = (props) => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/signup" element={<RegistrationForm/>}/>
            </Routes>
        </BrowserRouter>
    );
};

export default ImageApp;
